import React, { Component } from "react";
import { render } from "@testing-library/react";
import PostForm from "./PostForm.js";
import FriendList from "./FriendList.js";
import LoginForm from "./LoginForm.js";
import Profile from "./Profile.js";
import FriendForm from "./FriendForm.js";
import Modal from "./Modal.js";


export default class Navbar extends React.Component {

    render(){
        let post = require("./post.svg");
        let friend = require("./friends.svg");
        let setting = require("./settings.svg");
        let help = require("./help.svg");
        let mainContent = React.createRef();

        return(
        <div id="sidenav" className="sidenav">
            <ul id="side-menu-items">
                <li className="pm admin student">
                    <button
                        className="link-button">
                        <img
                            src={post}
                            className="sidenav-icon"
                            alt="Posts"
                            title="Posts"
                        />
                    </button>
                </li>
                <li className="pm admin">
                    <button
                        className="link-button"
                    >
                        <img
                            src={friend}
                            className="sidenav-icon"
                            alt="Friends"
                            title="Friends"
                        />
                    </button>
                </li>
                <li className="pm admin">
                    <button
                        className="link-button"
                    >
                        <img
                            src={setting}
                            className="sidenav-icon"
                            alt="Settings"
                            title="Settings"
                        />
                    </button>
                </li>
                <li className="pm admin">
                    <button
                        className="link-button"
                    >
                        <img
                            src={help}
                            className="sidenav-icon"
                            alt="Settings"
                            title="Settings"
                        />
                    </button>
                </li>
            </ul>
        </div>
        );
            }

}
